import './App.css';
import NavBar from './components/NavBar';

function App() {
  switch (window.location.pathname) {
    case '/about':
      return <h1>About</h1>;
    case '/contact':
      return <h1>Contact</h1>;
    default:
      return <h1>Home</h1>;
  }
  return (
    <NavBar />
  );
}

export default App;
